import React from 'react';
import { Container, Row, Col } from 'reactstrap';
import { useParams } from 'react-router';
import tshirtList from '../../../shared/shirts';
import classes from './TShirtPage.module.css';
import ColorButton from './ColorButton';

// function addColorButton(colors) {

//     var butDiv = document.querySelector(".button")

//     for(var i = 0; i < Object.keys(colors).length; i++) {
//         console.log(Object.keys(colors).length)
//         // alert("inside create button")
//         var colorButton = document.createElement('button');
//         colorButton.textContent = Object.keys(colors)[i];
//         console.log(colorButton)
//         butDiv[i].appendChild(colorButton)
//         ReactDOM.render()
//         // but.appendChild(colorButton)
//         // colorButton.textContent = Object.keys(but["colors"])[i];

//     }

// }

const TShirtPage = () =>{

    const { name } = useParams();
    const Tshirt= tshirtList.filter((shirt) => shirt.name === name)[0];
    const { description, price, colors } = Tshirt;
    console.log(colors)
    // console.log(Object.keys(colors).length)
    // console.log(Object.keys(colors)[0])
    // console.log(Object.keys(colors)[1])
    // console.log(Object.keys(colors)[2])
    // console.log(Object.keys(colors)[3])



    return (
        <Container>
            <h1>{name}</h1>
            <Row className={classes.row}>
                <Col>
                    <img style={{ width: '100%' }} src={colors.white.front} alt={name} />
                </Col>


                <Col>
                <h2 className={classes.price}>{price}</h2>
                <div>{description}</div>
                <div>
                    <div>Side: </div>
                    <button>Front</button>
                    <button>Back</button>
                </div>

                <div className="button">
                    <ColorButton props={colors}></ColorButton>
                </div>

                <div>
                     <div>Quantity</div>
                     <select>
                        <option value="1">1</option>
                        <option value="2">2</option>
                        <option value="3">3</option>
                        <option value="4">4</option>
                        <option value="5">5</option>
                        <option value="6">6</option>
                        <option value="7">7</option>
                        <option value="8">8</option>
                        <option value="9">9</option>
                        <option value="10">10</option>
                        <option value="11">11</option>
                        <option value="12">12</option>
                        <option value="13">13</option>
                        <option value="14">14</option>
                        <option value="15">15</option>
                        <option value="16">16</option>
                        <option value="17">17</option>
                        <option value="18">18</option>
                        <option value="19">19</option>
                        <option value="20">20</option>
                     </select>
                </div>

                <div>
                    <div>Size:</div>
                    <select>
                        <option value="Women’s XS">Women’s XS</option>
                        <option value="Women’s S">Women’s S</option>
                        <option value="Women’s M">Women’s M</option>
                        <option value="Women’s L">Women’s L</option>
                        <option value="Women’s XL">Women’s XL</option>
                        <option value="Women’s 2XL">Women’s 2XL</option>
                        <option value="Men’s XS">Men’s XS</option>
                        <option value="Men’s S">Men’s S</option>
                        <option value="Men’s M">Men’s M</option>
                        <option value="Men’s L">Men’s L</option>
                        <option value="Men’s XL">Men’s XL</option>
                        <option value="Men’s 2XL">Men’s 2XL</option>
                    </select>
                </div>

                <div>
                    <button>Add To Cart</button>
                </div>




                </Col>
            </Row>
        </Container>

    )



}
export default TShirtPage;
